import React from "react";
import ReactDOM from "react-dom";

function Joke(props) {
  return (
    <div classname="joke">
      <h1 style={{ display: props.question ? "block" : "none" }}>
        Question: {props.punchLine}
      </h1>
      <p>{props.answer}</p>
    </div>
  );
}

export default Joke;
